import React from "react";

const Navbar = () => {
    return (
        <nav>
            <div className="logo">
                <i className="fas fa-mountain"></i>
                <h4>Mountains</h4>
            </div>
            <ul className="navlinks">
                <li>
                    <a href="#">포항연탄은행</a>
                </li>
                <li>
                    <a href="#">후원안내</a>
                </li>
                <li>
                    <a href="#">자원봉사</a>
                </li>
                <li>
                    <a href="#">이야기나눔</a>
                </li>
            </ul>
        </nav>
    );
};

export default Navbar;
